ベープマット セット 30枚入<br>ブランド：ベープマット<br>販売・製造元：フマキラー<br><br>蚊によくきく電子蚊取りです。<br>どんな部屋にもすっきり置けるシンプルな器具デザイン。<br> <br><br><br>使用方法<br>1.ベープマットのアルミ包装を破ってマットを取り出し、発熱体中央に密着するようにのせて下さい。<br>2.器具のプラグをコンセント(100V)に差し込み、スイッチを押してONにし、パイロットランプの点灯を確かめて下さい。<br>*窓を開けて使用する場合、器具を風上に置くと効果的です。<br>3.使用後は必ずスイッチを切って下さい。<br>*使用済みのマットはすみやかに燃えるゴミとして捨てて下さい。<br> 効能蚊成虫の駆除 <br><br>使用上の注意<br>・定められた<br><br>使用方法<br>を必ず守る。<br>この器具はベープマット専用なので、他の用途には使用しない。<br>・<br><br>使用上の注意<br>等(マット小箱の裏面)をよく読んで使用する。<br>・洗剤、水、しょうゆ、油などの液体を器具にかけない。<br>故障やショート(発火)の原因となります。<br>・器具の分解、修理、改造は絶対にしない。<br>事故や故障の原因となります。<br>・使用中、使用後は小児の手に触れさせない。<br>・使用中は器具の発熱体やそのまわりが熱くなるので、手を触れたり、指を差し込んだりしない。<br>やけどの原因となります。<br>・濡れた手で器具に触れたり、針金やピンなどを器具内に差し込んだりしない。<br>感電や故障の原因となります。<br>・器具は水平になるように設置し、横や斜めにして使用しない。<br>マットが発熱体からはずれたり、ずれたりして充分な効果が得られないことがあります。<br>・白い壁(壁紙)のところで長時間使用すると、黄色のシミが付くことがあるので注意する。<br>・カーテン、タンスや椅子等の陰で使用すると、薬剤がこもって壁を汚すことがあるので注意する。<br>・100V以外の電源では使用しない。<br>事故や故障の原因となります。<br>・コードを強く引っ張ったり、コードを持って器具を運んだりしない。<br>故障の原因となります。<br>・コードやプラグが熱くなっている場合、コードに触れたり折り曲げたりするとランプがついたり消えたりする場合はすぐに使用を中止する。<br>・器具が汚れた場合は、乾いた布などでふきとり、クリーナー、洗剤などの使用をさける。<br> 保管および取扱い上の注意・直射日光、高温をさけて小児の手の届かない所に保管する。<br>・1ヶ月以上使用しないときは、器具の汚れを拭き取ってからこの箱やポリ袋などに入れて保管する。<br>*必要に応じて読めるように、箱は保管する。<br>*器具を長年(7-8年)使用すると経年劣化を起こす可能性が高くなります。<br>長年お使いくださった器具は、新しい器具に交換して下さい。<br> <br>成分<br>有効成分：d・d-T80-プラレトリン(ピレスロイド系) 8mg/枚その他の成分：ジブチルヒドロキシトルエン、香料、着色剤、灯油、パルプ板、他1成分 使用の目安ベープマット1枚で、4.5-8畳の部屋で12時間効き目が持続します。<br><br> 原産国器具：大下産業 インドネシア工場薬剤：日本 <br>日用品／虫よけ・殺虫剤・忌避／蚊取り用品／電子蚊取り器(コンセント)<br>JANコード： 4902424427103<br><br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
